import React from 'react';
import './Navbar.css';  // Add some styling

const Navbar = ({ setCurrentPage }) => {
    return (
        <nav className="navbar">
            <ul>
                <li>
                    <button onClick={() => setCurrentPage('calendar')}>
                        Calendar
                    </button>
                </li>
                <li>
                    <button onClick={() => setCurrentPage('addData')}>
                        Add Data
                    </button>
                </li>
                <li>
                    <button onClick={() => setCurrentPage('viewData')}>
                        View Data
                    </button>
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
